import React, { useEffect, useState } from 'react';
import AOS from 'aos';
import 'aos/dist/aos.css';
import Photo from './compoment/photo';
import './App.css';
import './css/main.css';
 function App() {
  const [offsetY, setOffsetY] = useState(50);
  const [scrollDirection, setScrollDirection] = useState('down');
   useEffect(() => {
    const fadeInElements = document.querySelectorAll('.fade-in-photo');
    const fadeOutElements = document.querySelectorAll('.fade-out-photo');
    const handleFadeInsOuts = () => {
      const currentYPos = window.pageYOffset;
      const screenHeight = window.innerHeight;
      const direction = currentYPos > offsetY ? 'down' : 'up'
       setOffsetY(currentYPos);
      setScrollDirection(direction);
       fadeInElements.forEach((fadeIn) => {
        const elementTop = fadeIn.getBoundingClientRect().top;
        if (elementTop < screenHeight && elementTop > 10) {
          const opacity = 1.5 - elementTop / screenHeight;
          fadeIn.style.opacity = opacity;
        }
      });
       fadeOutElements.forEach((fadeOut) => {
        const elementTop = fadeOut.getBoundingClientRect().top;
        const elementBottom = fadeOut.getBoundingClientRect().bottom;
        if (elementBottom < screenHeight && currentYPos === 0) {
          const opacity = elementBottom / screenHeight;
          fadeOut.style.opacity = opacity;
        } else {
          fadeOut.style.opacity = 0;
        }
      });
    };
    window.addEventListener('scroll', handleFadeInsOuts);
    return () => {
      window.removeEventListener('scroll', handleFadeInsOuts);
    };
  }, [offsetY, scrollDirection]);

   return (

    <div className="container">
      <div className='about' ></div>
      <div className='projectIot'>
        <div className='textZone'>
          <h1><h2>寵物自動餵食器</h2>智慧家居</h1>

          <p>利用<span> Raspberry Pi、Python</span></p>
          <p>構建一個能夠紀錄寵物進食狀態的裝置</p>
          <p>並透過網頁的方式呈現</p>

        </div>
        <div className='photoZone'></div>
      </div>
      <div className='projectmedia'>
        <div className='photoZone'></div>
        <div className='textZone'>
          <h1><h2>射擊遊戲外掛</h2>圖像辨識</h1>
          <p>利用<span> Mediapipe</span></p>
          <p>令遊戲角色自動瞄準敵人並攻擊</p>
          <p>提供不同的思路杜絕外掛</p>

        </div>
      </div>
      <div className='projectUnity'>
        <div className='textZone'>
          <h1><h2>自製 Roguelike</h2>Unity實作</h1>

          <p>利用<span> Unity</span></p>
          <p>自製的一款高隨機性的地牢遊戲</p>
        </div>
        <div className='photoZone'></div>
      </div>
      <div className='projectNLP'>
        <div className='photoZone'></div>
        <div className='textZone'>
          <h1><h2>伴星聊癒</h2>ＮＬＰ技術應用</h1>
          <p>利用<span> GPT Python ReactJS </span></p>
          <p>構建的一個具備遊戲治療功能的平台</p>
          <p>供自閉症患者使用能透過此平台改善病況</p>

        </div>
      </div>

      {/* <div className="about">
        <div className="textZone"></div>
      </div>
      <div className='projectContainer'>
          <div className={`sideProject ${scrollDirection === 'down' ? 'slide-in' : 'slide-out'}`}>
          <Photo/>
          <div className="projectZone">
            <h1 >畢業專題</h1>
            <p className="fade-in">
              利用ＮＬＰ技術並結合ReactJS與Python，替自閉症患者構建一個具備遊戲性治療的平台，其中詞頻分析與GPT模型為一切分析的基礎◦
            </p>
          </div>
        </div>
      </div> */}

    </div>
  );
}
 export default App;
